  return (
    <div className=" flex md:flex-row flex-col md:justify-evenly justify-center items-center py-28  ">
      <div>
        <button className="p-8 rounded-3xl text-3xl border-green-200 border-2 text-white" >Explore</button>
      </div>

      <div>
        <div className="w-80 border-gray-300 border-8 rounded-full">
          <img className="w-60 mx-7 rounded-full" src={Image} alt="" />
        </div>
        <div className="flex flex-col justify-center items-center">
          {" "}
          <h1 className="text-6xl mt-8 font-bold text-green-200">Frontend</h1>
          <h1 className="text-6xl mt-3 font-bold text-green-200">Developer</h1>
        </div>
      </div>
      <div className="flex flex-col items-center ">
        <div className="flex flex-col justify-center items-center">
          <h1 className="text-xl font-bold md:text-3xl mt-8 text-indigo-200">
            I like to craft,different solid web{" "}
          </h1>
          <h1 className="text-xl font-bold md:text-3xl text-indigo-200">
            designs with better efficiency and{" "}
          </h1>
          <h1 className="text-xl font-bold md:text-3xl text-indigo-200">
            nice user experience{" "}
          </h1>
        </div>
      </div>
    </div>
  );
};

export default intro;
